import project1 from '../asset/pro1.png';
import project2 from '../asset/pro2.png';
import project3 from '../asset/pro3.png';


const PROJECTS = [
    {
        title:'Example React App',
        description:'A react APP that Dev built, involving JS and core web techs statck',
        link:'https://github.com/hl896/hl896.github.io',
        images:project1
    },

    {
        title:'Our API',
        description:'A Restiful API that Dev built, involving GET and POST request',
        link:'https://github.com/hl896/hl896.github.io',
        images:project2
    },

    {
        title:'Operating System Project',
        description:'Our system that Dev built, involving Ubuntu and OS branch',
        link:'https://github.com/hl896/hl896.github.io',
        images:project3
    },
];


export default PROJECTS;
